{
    const [message, setMessage] = useState({});

    useEffect(()=>{
        axios.get('http://127.0.0.1:5000/flask/hello').then(response => {
          alert("SUCCESS", response)
          setMessage(response)
        }).catch(error => {
          alert(error)
        })

      }, []);

      return (
        <header class="App-header">
